def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = True   # set wait_for_nl to True initially
    for char in prefix:
        current_line += char
        if wait_for_nl:
            if char == '\n':
                if current_line.strip() and current_column < column:
                    return ''.join(lines), prefix[len(''.join(lines)):]  # return the correct substring
                lines.append(current_line)
                current_line = ""
                current_column = 0
                wait_for_nl = True  # set wait_for_nl to True when a line break is encountered
            elif char == ' ':
                current_column += 1
            elif char == '\t':
                current_column += 4
        else:
            # reset wait_for_nl when other cases occur
            if char == '\n':
                current_column = 0
                wait_for_nl = True
            else:
                wait_for_nl = False
    return ''.join(lines), current_line
